import { IconContext } from "react-icons"
import { IoMdArrowDropdown } from "react-icons/io"
import '../styles/App.css'

function CardListItem(props) {
    return (
        <li>{props.item}</li>
    )
}

const ProjectCard = ({projectName, date, description, languages, links}) =>  {

    return (
        <div className="transition-colors blur-md ease-in-out duration-300 border pt-4 pr-2 pl-2 pb-1 shadow-xl rounded-md w-80 hover:from-blue-800 hover:to-purple-700 hover:bg-gradient-to-r hover:text-white">
            <div className="flex justify-between">
                <h3 className="text-2xl font-bold subpixel-antialiased">{projectName}</h3>
                <div className="flex items-center ">
                    <IconContext.Provider value={{size: "1.75em"}}>
                        <div>
                            <IoMdArrowDropdown/>
                        </div>
                    </IconContext.Provider>
                </div>
            </div>
        </div>
    )
}

export default ProjectCard
